static int __stdcall _dcom_IID_Lookup(const IID* pIID, int* pIndex)
{
    int low = 0, high = 1;

    while (low <= high)
    {
        int pos = (low + high) / 2;
        int res = IID_GENERIC_CHECK_IID(_dcom, pIID, pos);
        if (!res) { *pIndex = pos; return 1; }
        if (res > 0) low = pos + 1;
        else high = pos - 1;
    }
    return 0;
}

